export let loadPage = () => {

    root.render(
        <BrowserRouter>
            <Provider store={store}>
                <App />
            </Provider>
        </BrowserRouter>
    );
}

loadPage(store.getState());

store.subscribe(() => {
    let state = store.getState();
    loadPage(state);
});
